  - !!python/tuple [description, 1]
  - !!python/unicode 'king of the greek gods, and the god of sky and thunder. he ruled
    the olympians from mount olympus and was married to his sister, hera.'
- !!python/tuple
  - !!python/tuple [description, 2]
  - !!python/unicode 'god of the sea, sources of fresh water, horses, and earthquakes.
    poseidon created the first horse out of seafoam for his sister, demeter. greek
    sailors worshipped him and prayed for calm seas and fair weather. he was married
    to amphitrite.'
- !!python/tuple
  - !!python/tuple [description, 3]
  - !!python/unicode 'the virgin goddess of the hearth, architecture, and of the right
    ordering of domesticity and the family. she would receive the first offering at
    every sacrifice in the household. it was her responsibility to tend to the sacred
    flame at mount olympus, and supposedly she gave up her seat at mount olympus because
    she became tired of the petty squabbles between the others. when new colonies
    were established, a flame from hestia''s public hearth in the mother city would
    be carried to the new settlement. she never married.'
- !!python/tuple
  - !!python/tuple [description, 4]
  - !!python/unicode 'the great messenger of the gods in greek mythology and a guide
    to the underworld. a trickster and the god of commerce, thieves, travelers, sports,
    athletes, and border crossings. on the first day after he was born he invented
    the lyre. later on, he also invented fire. he had several consorts, but reportedly
    never married.'
- !!python/tuple
  - !!python/tuple [description, 5]
  - !!python/unicode 'queen of the greek gods, and the god of marriage, women, and
    birth. she ruled the olympians from mount olympus and was married to her brother,
    zeus'
- !!python/tuple
  - !!python/tuple [description, 6]
  - !!python/unicode 'the crippled blacksmith of the gods, he was the god of technology,
    blacksmiths, craftsmen, metals, fire, and vulcanoes. he was worshipped in the
    manufacturing and industrial centers of greece. his first wife was aphrodite,
    and later on married kharis.'
- !!python/tuple
  - !!python/tuple [description, 7]
  - !!python/unicode 'the god of the underworld as well as the god of riches, he maintains
    the balance between life and death, and rules the realm of the dead. he was married
    to persephone and indirectly brought about the existence of the seasons through
    the events leading up to their marriage.'
- !!python/tuple
  - !!python/tuple [description, 8]
  - !!python/unicode 'the goddess of the harvest and the seasons, she also presided
    over the sanctity of marriage, the sacred law, and the cycle of life and death.
    the seasons were brought around as part of an agreement between her and hades.
    during the six months her daughter persephone spends with hades, fall and winter
    occur. when she is reunited with persephone, spring and summer occur. she never
    married.'
- !!python/tuple
  - !!python/tuple [description, 9]
  - !!python/unicode 'daughter of zeus and the titan metis, she was the virgin patron
    goddess of athens, and the goddess of wisdom, warfare, divine intelligence, and
